import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <div className="h-4">
      <nav>
        <Link to="/about">About</Link>
        <Link to="/experience">Experience</Link>
      </nav>
    </div>
  );
};

export default Navigation;
